Verenigde Staten
Komedie / Drama
100 minuten

geregisseerd door Michael W. Watkins
met Kurt Doss, Raziel Jordan en Lurie Poston

Een promotor van vechters heeft grote schulden bij zijn oneerlijke rivaal. Hij is wanhopig op zoek naar een nieuwe vechter en zijn oog valt op een klusjesman van een kerk die 450 pond weegt. De klusjesman, die zijn hele leven in een weeshuis gezeten heeft, besluit uit naam van alle wezen deel te nemen aan het gevecht.

